import axios from 'axios';

class Posts extends React.Component{
    constructor(props){
        super(props);

        this.state ={
            posts : []
        }
    }

    componentDidMount(){
        axios.get('https://jsonplaceholder.typicode.com/posts')
        .then((response)=>{
            console.log(response)
            this.setState({
                posts : response.data.posts.slice(0,10)
            })
        })
    }
